import itertools
# Not feasible on most machines for large numbers
def find_a_sub_n(n):
    c = 0
    for q in itertools.product(*([['0','1','2']]*n)):
        h = ''.join(q)
        if not (('11' in h) and ('00' in h)):
            c = c+1
    return c

